import * as Linking from 'expo-linking';

export default {
    prefixes: [Linking.makeUrl('/')],
    config: {
        screens: {
            Root: {
                screens: {
                    Wallet: {
                        screens: {
                            Wallet: 'Wallet',
                        },
                    },
                    Send: {
                        screens: {
                            Send: 'Send',
                        },
                    },
                    SendToken: {
                        screens: {
                            SendToken: 'Send Token',
                        },
                    },
                    Options: {
                        screens: {
                            Options: 'Options',
                        },
                    },
                },
            },
            NotFound: '*',
        },
    },
};
